// Get the appropriate Side from a string
public static Side getSide(String sideName) {
  if (FRONT.getLabel().equals(sideName)) {
    return FRONT;
  }
  else if (BACK.getLabel().equals(sideName)) {
    return BACK;
  }
  return null;
}

